import { useEffect, useState } from "react";
import axios from "axios";

type AxiosResponse = object | null;

const useGitProjects: object = () => {
  const [gitRepos, setGitRepos] = useState(null);

  useEffect(() => {
    const fetchGit = async () => {
      await axios("https://api.github.com/users/craigwh10/repos");
    };
    let result: AxiosResponse = fetchGit();
    console.log(result);
    setGitRepos(result);
  }, []);

  return gitRepos;
};

export default useGitProjects;
